Here is a sample code for a chrome extension that takes screenshots of the current tab and saves them to a folder on your computer:
```
// manifest.json
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes screenshots of the current tab and saves them to a folder on your computer.",
  "manifest_version": 2,
  "permissions": [
    "activeTab",
    "tabs",
    "storage"
  ],
  "background": {
    "scripts": ["background.js"]
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  }
}

// background.js
chrome.tabs.onActivated.addListener(function(tabId, changeInfo, tab) {
  chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
    chrome.storage.sync.set({screenshot: dataUrl}, function() {
      console.log("Screenshot saved to storage.");
    });
  });
});

// popup.html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Extension</title>
    <link rel="stylesheet" href="popup.css">
  </head>
  <body>
    <button id="take-screenshot">Take Screenshot</button>
    <div id="screenshot"></div>
    <script src="popup.js"></script>
  </body>
</html>

// popup.js
document.getElementById("take-screenshot").addEventListener("click", function() {
  chrome.storage.sync.get("screenshot", function(result) {
    if (result.screenshot) {
      document.getElementById("screenshot").src = result.screenshot;
    } else {
      console.log("No screenshot found in storage.");
    }
  });
});
```
In this code, we first define the manifest.json file, which specifies the name, version, description, and permissions of the extension. We also specify the background script and the popup page.

In the background.js file, we listen for the onActivated event, which is triggered when the user switches to a new tab. When this event is triggered, we call the chrome.tabs.captureVisibleTab method to capture a screenshot of the current tab. We then save the screenshot to the chrome.storage.sync object, which is a key-value store that is shared across all tabs and windows.

In the popup.html file, we define the HTML for the popup page. We have a button that, when clicked, calls the chrome.storage.sync.get method to retrieve the screenshot from storage. If a screenshot is found, we set the src attribute of the screenshot element to the URL of the screenshot. Otherwise, we log a message to the console.

